object Solution {
    def minimumIndex(nums: List[Int]): Int = {
        val n = nums.length
        val dominant = nums.groupBy(identity).maxBy(_._2.length)._1
        val totalCount = nums.count(_ == dominant)

        def isValidSplit(index: Int): Boolean = {
            val leftCount = nums.take(index + 1).count(_ == dominant)
            val rightCount = totalCount - leftCount
            val leftValid = leftCount * 2 > index + 1
            val rightValid = rightCount * 2 > n - index - 1
            leftValid && rightValid
        }

        (0 until n - 1).find(isValidSplit).getOrElse(-1)
    }
}
